    the earliest stage of sporulation and will eventually lyse on the plate. It is
    important to subculture the strain soon after it arrives. Finally, cultures should
    be kept at room temperature and never stored under refrigeration. B. subtilis
    RUB331 is definitely not wild-type.  It was created by transforming DNA (total
    gDNA?) from wt (B. subtilis 168T.sup.+) into RUB830.  It's unclear where RUB830
    originated.  Earliest reference to "RUB 330" that I can find is from 1976 (https://jvi.asm.orgasbin/content/jvi/21/2/522.full.pdf).  ATCC
    lists RUB331 as a "transformation host", but I only find a limited number of papers
    that reference it, perhaps because it was patented.
