  id: MS:692
  name: MS_692
  principal_investigator: person:23
  references: "1.\tIp HS, Torchetti MK, Crespo R, Kohrs P, DeBruyn P, Mansfield KG,\
    \ Baszler T, Badcoe L, Bodenstein B, Shearn-Bochsler V, Killian ML, Pedersen JC,\
    \ Hines N, Gidlewski T, DeLiberto T, Sleeman JM. 2015. Novel Eurasian Highly Pathogenic\
    \ Avian Influenza A H5 Viruses in Wild Birds, Washington, USA, 2014. Emerging\
    \ Infect Dis 21:886-890.\r\n2.\tLeyson C, Youk SS, Smith D, Dimitrov K, Lee DH,\
    \ Larsen LE, Swayne DE, Pantin-Jackwood MJ. 2019. Pathogenicity and genomic changes\
    \ of a 2016 European H5N8 highly pathogenic avian influenza virus (clade 2.3.4.4)\
    \ in experimentally infected mallards and chickens. Virology 537:172-185."
  status: In Progress
  summary: The virus is a reassortant of two H5N8 clade 2.3.4.4 highly pathogenic
    avian influenza viruses (HPAIVs). It has the polymerase complex (PB2,PB1,PA,NP)
    of A/Tufted duck/Denmark/11740-LWPL/2016 (Genbank MN708198-205) and HA,NA,M, NS
    of A/gyrfalcon/Washington/41088-6/2014 (Genbank KP307981-988). Both virus isolates
    were from wild birds, and all genes are of Eurasian origin. The differences between
    them is that GF14 is from HA Group A and 2014-2015 outbreak in North America [1],
    whereas TD16 is from HA group B and the 2016-2017 outbreak in Europe [2].
